import React, { Component } from "react";

class Customer extends React.Component {
    render () {
        return (
            <div>
                <CustomerProfile name={this.props.name} id={this.props.id} image={this.props.image} />
                <CustomerInfo birthday={this.props.birthday} gender={this.props.gender} job={this.props.gender} />
            </div>
        )
    }
}

class CustomerProfile extends React.Component {
    render () {
        return (
            <div>
                <img src={this.props.image} alt="Profile Image" />
                <h2>{ this.props.name } ({ this.props.id })</h2>

            </div>
        )
    }
}

class CustomerInfo extends React.Component {
    render () {
        return (
            <div>
                <p>{ this.props.birthday }</p>
                <p>{ this.props.gender }</p>
                <p>{ this.props.job }</p>
            </div>
        )
    }
}

export default Customer;
